INSERT INTO "m_directionsforusesection" VALUES (8,NULL,'DIRECTIONS FOR USE','It is a violation of Federal law to use this product in a manner inconsistent with its labeling.','R',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,5,NULL);
