INSERT INTO "m_generalstatement" VALUES (25,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.','R',NULL,NULL,13,NULL);
INSERT INTO "m_generalstatement" VALUES (26,NULL,'If on skin or clothing\n   - Take off contaminated clothing.\n   - Rinse skin immediately with plenty of water for 15-20 minutes.',NULL,NULL,1,14,NULL);
INSERT INTO "m_generalstatement" VALUES (27,NULL,'If swallowed\n   - Call a poison control center or doctor immediately for treatment advice.\n   - Have person sip a glass of water if able to swallow.\n   - Do not induce vomiting unless told to do so by the poison control center or doctor.\n   - Do not give anything by mouth to an unconscious person.',NULL,NULL,2,14,NULL);
INSERT INTO "m_generalstatement" VALUES (28,NULL,'If inhaled\n   - Move person to fresh air.\n   - If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible.',NULL,NULL,3,14,NULL);
INSERT INTO "m_generalstatement" VALUES (29,NULL,'If in eyes\r\n   - Hold eye open and rinse slowly and gently with water for 15-20 minutes.\r\n   - Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,NULL,4,14,NULL);
INSERT INTO "m_generalstatement" VALUES (30,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.','R',NULL,NULL,15,NULL);
