INSERT INTO "m_generalstatement" VALUES (59,NULL,'PHYSICAL OR CHEMICAL HAZARDS\r\nDo not mix with oxidizers, anionic soaps and detergents.\r\nDo not use or store near heat or open flame.',NULL,NULL,1,31,NULL);
INSERT INTO "m_generalstatement" VALUES (60,NULL,'Corrosive. Causes irreversible eye damage and skin burns. Harmful if swallowed, inhaled or absorbed through the skin. Avoid breathing spray mist. Do not get in eyes, on skin, or on clothing. Wear goggles or face shield, rubber gloves and protective clothing when handling. Wash thoroughly with soap and water after handling and before eating, drinking, or using tobacco. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,NULL,30,NULL);
INSERT INTO "m_generalstatement" VALUES (61,NULL,'ENVIRONMENTAL HAZARDS\r\nDo not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product into sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA. ',NULL,NULL,2,31,NULL);
INSERT INTO "m_generalstatement" VALUES (62,NULL,'IF ON SKIN OR CLOTHING: Take off contaminated clothing. Rinse skin immediately with plenty of water for 15 ? 20 minutes. Call a poison control center or doctor for treatment advice.',NULL,NULL,1,29,NULL);
INSERT INTO "m_generalstatement" VALUES (63,NULL,'IF IN EYES: Hold eye open and rinse slowly and gently with water for 15 ? 20 minutes.  Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye. Call a poison control center or doctor for treatment advice.',NULL,NULL,2,29,NULL);
INSERT INTO "m_generalstatement" VALUES (64,NULL,'IF SWALLOWED: Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow.  Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,NULL,3,29,NULL);
INSERT INTO "m_generalstatement" VALUES (65,NULL,'IF INHALED: Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice.',NULL,NULL,4,29,NULL);
INSERT INTO "m_generalstatement" VALUES (66,NULL,'NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage.',NULL,NULL,5,29,NULL);
INSERT INTO "m_generalstatement" VALUES (67,NULL,'Have the product container or label with you when calling a poison control center or doctor or going for treatment.',NULL,NULL,6,29,NULL);
