INSERT INTO "m_marketingstatement" VALUES (22,NULL,'Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)','R',NULL,1,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (23,NULL,'A multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test. Disinfects, cleans, and deodorizes in one labor-saving step.','R',NULL,2,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (24,NULL,'Recommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households. Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.','R',NULL,3,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (25,NULL,'Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical)stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).','R',NULL,4,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (26,NULL,'Use [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.','R',NULL,5,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (27,NULL,'Use [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs. Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse. [Caution: Cleaning at the recommended 120F. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]','R',NULL,6,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (28,NULL,'Recommended for use\r\n\r\nFederally inspected meat and poultry plants on all hard, nonporous surfaces in inedible product processing areas, non-processing areas, and / or exterior areas. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a floor and wall cleaner for use in all departments. Food products and packaging material must be removed from the room or carefully protected. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.','R',NULL,7,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (29,NULL,'Recommended for use in tanning salons.','R',NULL,8,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (30,NULL,'Recommended for use on [tanning beds], [and] [tanning equipment]. ','R',NULL,9,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (31,NULL,'Formulation HWS-256 is effective at controlling mold and mildew odor on mattresses, pillows and shower curtains.','R',NULL,10,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (32,NULL,'Formulation HWS-256 can be used in the laundry to control odors on musty bedding and linens. Test on a small inconspicuous area before using.','R',NULL,11,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (33,NULL,'Formulation HWS-256 may be used on mildew stains in damp areas such as bathrooms, showers, kitchens, basements and laundry rooms.','R',NULL,12,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (34,NULL,'Formulation HWS-256</strong></font><font face=\"Arial, sans-serif\"> may be used in work areas such as tool rooms and garages for odor control and light duty cleaning.','R',NULL,13,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (35,NULL,'Formulation HWS-256 may be used to remove odors caused by flooding and smoke from fires.','R',NULL,14,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (36,NULL,'Formulation HWS-256 leaves a clean fresh scent.','R',NULL,15,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (37,NULL,'Formulation HWS-256 provides long lasting freshness against tough (pet) odors from litter boxes and pet accidents.','R',NULL,16,5,NULL);
INSERT INTO "m_marketingstatement" VALUES (38,NULL,'<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\"><em>(Fungi:)</em></font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">Aspergillus niger</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">Candida albicans</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">Trichophyton mentagrophytes [Athlete?s Foot Fungus]</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">[a cause of Ringworm] [a cause of Ringworm of the foot]</font></font></p>','R',NULL,1,6,NULL);
INSERT INTO "m_marketingstatement" VALUES (39,NULL,'<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><em>(Bacteria:)</em></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Pseudomonas aeruginosa</font><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Staphylococcus aureus</font><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Salmonella choleraesuis</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Acinetobacter calcoaceticus</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Bordetella bronchiseptica</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Chlamydia psittaci</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Enterobacter aerogenes</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Enterobacter cloacae</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Enterococcus faecalis ? Vancomycin Resistant (VRE)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Escherichia coli</font><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Fusobacterium necrophorum</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Klebsiella pneumoniae</font><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Legionella pneumophila</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Listeria monocytogenes</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Pasteurella multocida</font></p>\r\n<p style=\"margin-right: -0.06in; margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Proteus mirabilis</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Proteus vulgaris</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Salmonella enteritidis </font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Salmonella typhi</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Salmonella typhimurium</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Serratia marcescens</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Shigella flexneri</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Shigella sonnei</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Staphylococcus aureus ? Methicillin resistant (MRSA)</font></p>\r\n<p style=\"margin-right: -0.15in; margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Staphylococcus aureus ? Vancomycin Intermediate Resistant (VISA)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Staphylococcus epidermidis</font><sup><font size=\"2\" face=\"Arial, sans-serif\">2</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Streptococcus faecalis</font><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">Streptococcus pyogenes </font><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">[Strep] </span></font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">[a cause of scarlet fever]</span></font></p>\r\n<p style=\"text-indent: 0.82in; margin-bottom: 0in;\" align=\"JUSTIFY\"><sup><font size=\"2\" face=\"Arial, sans-serif\">1</font></sup><font face=\"Arial, sans-serif\"> ATCC &amp; antibiotic-resistant strain</font></p>\r\n<p style=\"text-indent: 0.82in; margin-bottom: 0in;\" align=\"JUSTIFY\"><sup><font size=\"2\" face=\"Arial, sans-serif\">2</font></sup><font face=\"Arial, sans-serif\"> antibiotic-resistant strain only</font></p>','R',NULL,2,6,NULL);
INSERT INTO "m_marketingstatement" VALUES (40,NULL,'<p><em><font face=\"Arial\">(Viruses:)</font></em></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial\">*Adenovirus Type 4</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">*Adenovirus Type 7 - at 2 oz. per gallon</span></font></p>\r\n<p style=\"margin-bottom: 0in; margin-left: 0.08in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 8pt;\" size=\"1\"><em><span style=\"background: #ffff00;\">(Note for Reviewer: 2 oz. per gallon dilution disinfection directions must be used if Adenovirus Type 7 is listed on the label)</span></em></font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Hepatitis B Virus (HBV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Hepatitis C Virus (HCV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Herpes Simplex Type 1</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Herpes Simplex Type 2</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Human coronavirus</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*HIV-1 (AIDS virus)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Influenza A / Hong Kong</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">*Respiratory Syncytial Virus (RSV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Rubella (German Measles)</font></p>\r\n<p style=\"text-indent: -0.2in; margin-bottom: 0in; margin-left: 0.2in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*SARS Associated Coronavirus [SARS] [cause of Severe Acute Respiratory Syndrome]</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Vaccinia [Pox virus]</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><em>(Animal Viruses:)</em></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Avian polyomavirus</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Canine distemper</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Feline leukemia</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Feline picornavirus </font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Infectious bovine rhinotracheitis</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Infectious bronchitis (Avian IBV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">* Newcastle Disease</span></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Pseudorabies (PRV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Rabies</font></p>\r\n<p style=\"margin-right: -0.06in; margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">*Transmissible gastroenteritis virus (TGE)</font></p>','R',NULL,3,6,NULL);
