INSERT INTO "m_marketingstatement" VALUES (43,NULL,'Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)','R',NULL,1,9,22);
INSERT INTO "m_marketingstatement" VALUES (44,NULL,'A multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test. Disinfects, cleans, and deodorizes in one labor-saving step.','R',NULL,2,9,23);
INSERT INTO "m_marketingstatement" VALUES (45,NULL,'Recommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households. Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.','R',NULL,3,9,24);
INSERT INTO "m_marketingstatement" VALUES (46,NULL,'Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical)stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).','R',NULL,4,9,25);
INSERT INTO "m_marketingstatement" VALUES (47,NULL,'Use [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.','R',NULL,5,9,26);
INSERT INTO "m_marketingstatement" VALUES (48,NULL,'Use [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs. Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse. [Caution: Cleaning at the recommended 120F. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]','R',NULL,6,9,27);
INSERT INTO "m_marketingstatement" VALUES (49,NULL,'Recommended for use\r\n\r\nFederally inspected meat and poultry plants on all hard, nonporous surfaces in inedible product processing areas, non-processing areas, and / or exterior areas. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a floor and wall cleaner for use in all departments. Food products and packaging material must be removed from the room or carefully protected. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.','R',NULL,7,9,28);
