INSERT INTO "m_marketingstatement" VALUES (109,'optional marketing language','Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)\r\n\r\nA multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO3) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test.  Disinfects, cleans, and deodorizes in one labor-saving step.\r\n\r\nRecommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households.  Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.\r\n\r\nDisinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical) stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).\r\n\r\nUse [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.\r\nUse [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs.  Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse.  [Caution: Cleaning at the recommended 120F. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]',NULL,NULL,NULL,41,NULL);
INSERT INTO "m_marketingstatement" VALUES (110,'Germicidal Detergent and Deodorant','Disinfectant, Cleaner, Mildewstat, Fungicide, Virucide*, Deodorizer (Odor Counteractant) (Odor Neutralizer) for Hospitals, Nursing Homes, Households, Food Service, Commercial, Institutional, and Industrial Use (Only) (Suitable) For Use in Meat and Poultry Plants.',NULL,NULL,1,42,NULL);
