INSERT INTO "m_storagedisposalstatement" VALUES (22,NULL,NULL,'R','Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,1,10,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (23,NULL,'Pesticide Storage','R','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,2,10,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (24,NULL,'Pesticide Disposal','R','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,3,10,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (25,NULL,'Container Disposal','R','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,'NA',NULL,NULL,4,10,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (26,NULL,NULL,'R','Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,NULL,11,21);
