INSERT INTO "m_storagedisposalstatement" VALUES (40,NULL,'Container Disposal','R','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,'NA',NULL,NULL,4,16,35);
INSERT INTO "m_storagedisposalstatement" VALUES (42,NULL,'Storage and Disposal','R','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA','',NULL,1,18,37);
INSERT INTO "m_storagedisposalstatement" VALUES (43,NULL,'Storage and Disposal','R','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,2,18,38);
INSERT INTO "m_storagedisposalstatement" VALUES (44,NULL,'Pesticide Disposal','R','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,3,18,39);
INSERT INTO "m_storagedisposalstatement" VALUES (45,NULL,'Pesticide Disposal','R','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,4,18,40);
INSERT INTO "m_storagedisposalstatement" VALUES (46,NULL,'Container Handling','R','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,5,18,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (48,NULL,NULL,NULL,NULL,NULL,'NA',NULL,NULL,NULL,20,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (49,NULL,'PESTICIDE STORAGE:',NULL,'Open dumping is prohibited.  Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,2,20,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (50,NULL,'Pesticide Disposal',NULL,'Pesticide wastes are acutely hazardous.  Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law.  If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,3,20,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (51,NULL,'Container Disposal',NULL,'(Plastic containers:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn.  If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles.  Empty residue into application equipment.  Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities.  If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities.  If burned, stay out of smoke.',NULL,'NA',NULL,NULL,4,20,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (52,NULL,'STORAGE AND DISPOSAL',NULL,'Store in original container in areas inaccessible to children. Do not reuse empty container.  Wrap and discard in trash (or recycle).',NULL,'NA',NULL,NULL,NULL,21,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (53,NULL,'DISPOSAL:',NULL,'Do not reuse container.  Wrap and put in trash collection.',NULL,'NA',NULL,NULL,NULL,22,NULL);
INSERT INTO "m_storagedisposalstatement" VALUES (54,NULL,'PESTICIDE STORAGE',NULL,'Open dumping is prohibited. Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,NULL,23,NULL);
