INSERT INTO "s_directionsforusestatement" VALUES (1,NULL,'<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">DILUTION: 1:256   ounce per gallon of water</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">(660 ppm quat) 1 ounce per 2 gallons of water</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">2 ounces per 4 gallons of water</font></font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">  2 ounces per 5 gallons of water</font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 9pt;\" size=\"2\">  4 ounces per 8 gallons of water</font></font></p>',NULL,'NA',NULL,'R',NULL,1,NULL,1,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (2,NULL,'<p align=\"CENTER\">DILUTION CHART</p>\r\n<p align=\"CENTER\">Correct Solution Strength</p>\r\n<p align=\"CENTER\">0.39% (1:256,  oz. per gallon)</p>\r\n<p align=\"CENTER\">PRODUCT WATER</p>\r\n<p align=\"CENTER\">  oz1 gallon</p>\r\n<p align=\"CENTER\">  2  oz. 5 gallons</p>',NULL,'NA',NULL,'R',NULL,2,NULL,1,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (3,NULL,'<p>This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.</p>','<p>This product is not for use on medical device surfaces.</p>','MD','(Note for reviewer: For labels that list medical premises and metal and / or stainless steel surfaces, one of the following statements must be used:)\r\n','R',NULL,1,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (4,NULL,'DISINFECTION / Cleaning / Deodorizing Directions: Remove heavy soil deposits from surface.  Then thoroughly wet surface with a use-solution of  oz. of the concentrate per gallon of water.  (Use 2 oz per gallon of water to kill Adenovirus Type 7). The use-solution can be applied with a cloth, mop, sponge, or coarse spray, or soaking.  For sprayer applications, use a coarse spray device.  Spray 6-8 inches from the surface, rub with a brush, cloth or sponge.  Do not breathe spray.  Let solution remain on surface for a minimum of 10 minutes.  Rinse or allow to air dry.  Rinsing of floors is not necessary unless they are to be waxed or polished. ',NULL,'NA',NULL,'R',NULL,2,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (5,NULL,'Food contact surfaces must be thoroughly rinsed with potable water.  This product must not be used to clean the following food contact surfaces: utensils, glassware and dishes.','This product is not for use on food contact surfaces.\r\n','FC','(Note for reviewer: One of the following statements must be used:)','R',NULL,3,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (6,NULL,'Bactericidal Stability of Use-Dilution: Tests confirm that Formulation HWS-256, when diluted in 400 ppm hard water (via use of automatic dispensing devices), remains effective against Pseudomonas aeruginosa, Staphylococcus aureus and Salmonella choleraesuis for (up to 7 days) (for up to one week) (for up to one month) (for up to 2 months) (for up to 3 months) (up to 4 months) (up to 5 months) (up to 6 months) (up to 7 months) (up to 8 months) (up to 9 months) (up to 10 months) (up to 11 months) (up to 12 months) (up to one year) when stored in a sealed container such as a spray bottle.  If product becomes visibly dirty or contaminated, the use-dilution must be discarded and fresh product prepared.  Always use clean, properly labeled containers when diluting this product.  Bactericidal stability of the use-dilution does not apply to open containers such as buckets or pails.\r\n','<p>Prepare a fresh solution daily or more often if the solution becomes visibly dirty or diluted.</p>','BU','Note to reviewer: one of the following two statements will be used:)','R',NULL,4,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (7,NULL,'TOILET BOWLS [ / URINALS] Swab bowl with brush to remove heavy soil prior to cleaning or disinfecting.  Clean by applying use-solution around the bowl and up under the rim.  Stubborn stains may require brushing.  To disinfect, first preclean to remove heavy soil, then remove or expel over the inner trap the residual bowl water. Pour in 3 oz. of the use-solution.  Swab the bowl completely using a scrub brush or mop, making sure to get under rim. Let stand for 10 minutes or overnight, then flush.',NULL,'NA',NULL,'R',NULL,5,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (8,NULL,'Fungicidal Directions:\r\nFor use in areas such as locker rooms, dressing rooms, shower and bath areas and exercise facilities follow disinfection directions.',NULL,'NA',NULL,'R',NULL,6,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (9,NULL,'MILDEWSTATIC INSTRUCTIONS: Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, nonporous surfaces such as walls, floors, and table tops.  Apply use-solution of  oz. per gallon of water with a cloth, mop, sponge, or coarse spray.  Make sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,'R',NULL,7,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (10,NULL,'CLEANING AND DISINFECTING HARD NONPOROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT (RESPIRATORS):\r\nPreclean equipment if heavily soiled to ensure proper surface contact. Add  oz. of Formulation HWS-256 to one gallon of water.  (Use 2 oz per gallon of water to kill Adenovirus Type 7).  Gently mix for a uniform solution.  Apply solution to hard, nonporous surfaces of the respirator with a brush, coarse spray device, sponge, or by immersion.  Thoroughly wet all surfaces to be disinfected.  Treated surfaces should remain wet for 10 minutes.  Remove excess solution from equipment prior to storage.  Comply with all OSHA regulations for cleaning respiratory protection (29 CFR 1910.134).',NULL,'NA',NULL,'R',NULL,8,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (11,NULL,'*Kills HIV-1 (AIDS virus) AND HBV (HEPATITIS b vIRUS) and HCV (Hepatitis C Virus) OF precleaned, environmental surfaces / objects previously soiled with blood / body fluids in health care settings or other settings in which there is an expected likelihood of soiling of inanimate surfaces / objects with blood / body fluids, and in which the surfaces / objects likely to be soiled with blood / body fluids can be associated with the potential for transmission of Human Immunodeficiency Virus Type I (HIV-1)(associated with AIDS) or Hepatitis B Virus (HBV) or Hepatitis C Virus (HCV).',NULL,'NA',NULL,'R',NULL,9,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (12,NULL,'SPECIAL INSTRUCTIONS FOR CLEANING AND DECONTAMINATION AGAINST HIV-1 (AIDS VIRUS) OR HBV OR HCV ON SURFACES / OBJECTS SOILED WITH BLOOD / BODY FLUIDS:\r\nPersonal Protection: Disposable protective gloves, gowns, face masks, or eye coverings as appropriate must be worn during all cleaning of blood / body fluids and during decontamination procedures.\r\nCleaning Procedures: Blood / body fluids must be thoroughly cleaned from surfaces / objects before application of disinfectant.\r\nContact Time: HIV-1 (AIDS virus) is inactivated after a contact time of 4 minutes at 25&#61616;C (77F) (room temperature).  HBV and HCV are inactivated after a 10 minute contact time.  Use a 10-minute contact time for all other viruses, fungi, and bacteria listed.\r\nDisposal of Infectious Materials: Blood / body fluids should be autoclaved and disposed of according to federal, state, and local regulations for infectious waste disposal.',NULL,'NA',NULL,'R',NULL,10,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (13,NULL,'SALON (BARBER) INSTRUMENTS AND TOOLS DISINFECTION (BACTERICIDE) / VIRUCIDE / FUNGICIDE DIRECTIONS:\r\nMix  oz of Formulation HWS-256 per gallon of water (or equivalent dilution) to disinfect hard, nonporous instruments and tools.  (Use 2 oz per gallon of water to kill Adenovirus Type 7.)  Completely immerse combs, brushes, rollers, razors, scissors, blades, manicure and other salon instruments and tools for 10 minutes. For heavily soiled instruments and tools, a preliminary cleaning is required. Rinse thoroughly and dry before use. Prepare a fresh solution daily or more often if the solution becomes visibly diluted, cloudy or soiled.\r\nNote: Plastics may remain immersed until ready to use. Stainless steel shears and instruments must be removed after 10 minutes, rinsed, dried and kept in a clean, non-contaminated receptacle. Prolonged soaking may cause damage to metal instruments.',NULL,'NA',NULL,'R',NULL,11,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (14,NULL,'DISINFECTION OF HARD, NON-POROUS SURFACES IN FOOTBATHS\r\nTo remove body oils, dead tissue, soil and all other buildups or organic matter on inanimate surfaces after using the footbath, drain the water and thoroughly clean all hard, non-porous surfaces with soap or detergent, then rinse with water.  Saturate surfaces with a use solution of  oz. per gallon of water (or equivalent use dilution) to exposed surfaces with a cloth, mop, sponge or sprayer.  (Use 2 oz per gallon of water to kill Adenovirus Type 7).  For spray applications, use a coarse spray device.  Do not breathe spray.  Brush or swab thoroughly and allow solution to stand for 10 minutes.  After the unit has been thoroughly disinfected, rinse all surfaces with fresh water.  Do not use equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,'R',NULL,12,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (15,NULL,'CLEANSING OF BODY SURFACES AND BODY ORIFICES OF HUMAN REMAINS: This product removes body secretions, soil, and blood, along with their accompanying malodor, from the surfaces and orifices of human remains.  Using a sponge or washcloth, bathe the entire body with a use-solution of  oz per gallon of water.  (Use 2 oz per gallon of water to kill Adenovirus Type 7.)  A soft hand brush may be employed on surfaces other than the face.  Prepare a fresh solution for each (cadaver) remains or when solution becomes visibly dirty or diluted.',NULL,'NA',NULL,'R',NULL,13,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (16,NULL,'FARM PREMISE, LIVESTOCK, POULTRY & TURKEY HOUSE DISINFECTANT\r\n\r\nDILUTION: 1:256	 ounce per gallon of water\r\n\r\n(Use 2 oz per gallon of water to kill Adenovirus Type 7.)  \r\n\r\n1.	Remove all animals and feeds from premises, trucks, coops, crates, and enclosures.\r\n\r\n2.	Remove all litter and manure from floors, walls, and surfaces of barns, pens, stalls, chutes, vehicles, and other facilities and fixtures occupied or traversed by animals.\r\n\r\n3.	Empty all troughs, racks, and other feeding and watering appliances.\r\n\r\n4.	Thoroughly clean all surfaces with soap or detergent, and rinse with water.\r\n\r\n5.	Saturate all surfaces with the recommended disinfecting solution for a period of 10 minutes.\r\n\r\n6.	Immerse all halters, ropes, and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure.\r\n\r\n7. Ventilate buildings, coops, cars, trucks, boats, and other closed spaces.  Do not house animals or employ equipment until treatment has been absorbed, set, or dried.\r\n\r\n8. After treatment with disinfectant, thoroughly scrub feed racks, troughs, automatic feeders, fountains, and waterers with soap or detergent, and rinse with potable water before reuse.',NULL,'NA',NULL,'R',NULL,14,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (17,NULL,'Veterinary Practice / Animal Care / Animal Laboratory / Zoos / Pet Shop / Kennels Disinfection Directions:  \r\nFor cleaning and disinfecting hard nonporous surfaces: equipment used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc.  Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Empty all feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Saturate surfaces with a use-solution of  oz. of FORMULATION HWS-256 per gallon of water (or equivalent dilution) for a period of 10 minutes. (Use 2 oz per gallon of water to kill Adenovirus Type 7.)  Wipe or allow to air dry.  Ventilate buildings and other closed spaces. Thoroughly scrub all treated surfaces that come into contact with food, including equipment used for feeding or watering, with soap or detergent and rinse with potable water before reuse. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,'R',NULL,15,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (18,NULL,'For Heavy Duty Cleaning and / or Odor Control: When greater cleaning is desired, use 1 - 2 oz. of Formulation HWS-256 per gallon of water.  Heavily soiled areas may require repeated cleaning before treatment.',NULL,'NA',NULL,'R',NULL,16,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (19,NULL,'CITRUS CANKER DISEASE CONTROL\r\nFor prevention of Citrus Canker Disease through treatment of equipment.  Effective against Xanthomonas axonopodis pv. citri (Citrus Canker Disease) at 2000 ppm active quat. Treatments can be applied to trucks, attached trailers, and field equipment including cargo area, wheels, tires, undercarriage, hood, roof, fenders, and any other hard nonporous equipment taken into infested areas.\r\nSaturate surfaces with a 1:84 use-dilution (5 oz. per 3 gallons of deionized water) (or equivalent dilution) (2000 ppm active quat) for a period of 10 minutes.  Allow to air dry.  All surfaces that come in contact with food or crop must be rinsed with potable water before reuse.  To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Thoroughly rinse or launder clothing before reuse.  Rinse footwear before reuse.',NULL,'NA',NULL,'R',NULL,17,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (20,NULL,'Formulation HWS-256 is effective at eliminating odors on porous surfaces such as upholstery, drapes, carpets, bedding, shower curtains, mattresses and non-porous surfaces such as walls and floors.  Excellent for fire restoration.',NULL,'NA',NULL,'R',NULL,18,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (21,NULL,'Other suggested Uses:  Homes, Veterinary Clinics, Fish Markets, Kennels, Trash Compactors, Offices, Beauty Salons, Locker Rooms, Health Spas, Conference rooms, Elevators, Smoking Areas, Lounges, Day Care Centers, Dry Cleaners, Theaters, Farms, Auditoriums and  Churches.\r\n \r\n',NULL,'NA',NULL,'R',NULL,19,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (22,NULL,'Deodorizing directions:\r\nNursing Homes, Hospitals, Hotels, Schools, Restaurants:  Using 1/2 oz. in chemical toilets, waste receptacles, bed pans, drainage bottles, diaper pails, hampers, disposals, commodes and air conditioner pans will eliminate odors.',NULL,'NA',NULL,'R',NULL,20,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (23,NULL,'Mopping Solutions, Automatic Scrubbers:  Use 1/2 oz. per gallon of cleaning solution to eliminate undesirable odors.\r\nLaundry:  oz. per load added during the final rinse cycle deodorizes all offensive odors.',NULL,'NA',NULL,'R',NULL,21,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (24,NULL,'Air Freshener/Automotive Uses:  2 oz. per gallon of water or desired concentration will effectively neutralize damp musty odors caused by mildew in storage areas, basements, closets and bathrooms.  Effective on smoking and cooking odors (garlic, fish, onions, etc.).  Automobile odors from tobacco, musty carpet smell and beverage smells will be eliminated.',NULL,'NA',NULL,'R',NULL,22,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (25,NULL,'Carpets:  oz. per gallon of shampoo solution eliminates odors associated with urine, vomit, smoke, and mildew.  Reapply after cleaning for freshening effects.  Allow to dry.',NULL,'NA',NULL,'R',NULL,23,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (26,NULL,'RV Holding Tanks:  Toilet waste:  cover bottom of holding tank with water and add  oz.  If odors return before time to empty, simply add  oz. to the tank.  Kitchen waste:  oz. of Formulation HWS-256 to gray water tank as needed to control malodors created by dirty dish water.',NULL,'NA',NULL,'R',NULL,24,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (27,NULL,'Pet Odors:  Use 2 - 3 oz. per gallon of water or desired concentration, for urine, feces, and vomit, in carpet and upholstery.  Clean prior to application then spray onto affected areas.  Test hidden area for colorfastness.  Allow 10 minutes contact time.  Then blot with clean cloth.  Allow to dry.  Also effective on pet bedding and litter boxes.',NULL,'NA',NULL,'R',NULL,25,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (28,NULL,'Sewage Backup, Water, Smoke Damage:  Use 1 ? 2 oz. per gallon of water or desired concentration.  Spray over affected areas before and after cleaning and extraction.  Allow ten minutes contact time.  Use proper ventilation; open windows.',NULL,'NA',NULL,'R',NULL,26,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (29,NULL,'Cleaning Solution:  Dilute  oz. per gallon of water for cleaning of kitchen counters, tables, walls, bathrooms, toilet seats, mopping floors and large routine applications.',NULL,'NA',NULL,'R',NULL,27,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (30,NULL,'WATER, SMOKE DAMAGE RESTORATION AGAINST ODOR-CAUSING BACTERIA AND FUNGI FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE:\r\nThis product is particularly suitable for use in water damage restoration situations against odor causing bacteria on the following porous and semi-porous materials: carpets, carpet cushions, subfloors, drywall, concrete, brick, trim and frame lumber, tackless strip and paneling.  Using appropriate dilution, saturate the affected materials with enough product to remain wet for at least 10 minutes.\r\nSewer Backup and River Flooding:  During mitigation procedures, dilute  oz. of the concentrate per gallon of water, allowing for the diluting effect of absorbed water within saturated materials.  Remove gross filth or heavy soil along with non-salvageable materials.  Saturate all affected areas with a coarse spray device before and after cleaning and extraction.\r\nCarpets, Carpet Cushions and Other Porous Materials such as Subfloors, Drywall, Concrete, Brick, Trim and Frame Lumber, Tackless Strip and Paneling: For water damage from a clean source, extract excess water.  Test hidden area for colorfastness.  Dilute  oz. of the concentrate per gallon of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil.  Saturate all affected areas with a coarse spray device.  Roll, brush or agitate into the materials and allow materials to remain wet for 10 minutes.  Follow with a thorough extraction.  Dry rapidly and thoroughly.\r\nSpecial instructions For Cleaning Carpet Against Odor Causing Bacteria: Use this product in industrial and institutional areas such as homes, motels, hotels, nursing homes, schools, and hospitals.  Use on wet-cleanable synthetic fibers.  Do not use on wool.  Vacuum carpet thoroughly prior to cleaning.  Test fabric for colorfastness. For portable extraction units: Mix  oz. of concentrate per gallon of water.  For truck mounted extraction machines: Mix  ? 1 oz. of concentrate per gallon of water and meter at 4 gallons per hour.  For rotary floor machines:  Mix  oz. of concentrate per gallon of water and apply at the rate of 300 ? 500 sq. ft. per gallon.  Do not mix this product with other cleaning products.  Follow the cleaning procedures specified by the manufacturer of the cleaning equipment.  After using the product, set the carpet pile and protect the carpet from furniture legs and bases while drying.  Do not over-wet.  If applied to stain resistant nylon carpet, apply a fabric protector according to the manufacturer?s directions.',NULL,'NA',NULL,'R',NULL,28,NULL,2,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (31,NULL,'It is a violation of Federal Law to use this product in a manner inconsistent with its labeling.',NULL,'NA',NULL,NULL,NULL,NULL,151,3,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (32,NULL,'For use on hard, non-porous surfaces in animal care facilities such as {{Surface}}. Remove gross filth and heavy soil deposits then thoroughly wet surfaces. Use 2 ounces per gallon of water (8 ounces per gallon against canine parvovirus and Porcine parvovirus) for a minimum contact time of 10 minutes in a single application. Can be applied with a cloth, mop, or sponge, as well as by coarse spray or soaking. The use solution is prepared fresh for each use then discarded. Rinsing is not necessary unless floors are to be waxed or polished. This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,152,4,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (33,NULL,'For use in areas such as {{Area Of Use}} follow disinfection directions.',NULL,'NA',NULL,NULL,NULL,NULL,153,5,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (34,NULL,'Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,154,6,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (35,NULL,'For disinfecting the following hard nonporous surfaces: equipment not used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc. Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with a solution of 2 oz of KennelSol per gallon of water (or equivalent dilution) (8 ounces per gallon against Canine parvovirus or Porcine parvovirus), using a cloth, mop, sponge, spray, or soaking for a period of 10 minutes. Ventilate buildings and other closed spaces. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,NULL,NULL,NULL,155,7,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (36,NULL,'{{Product Name}} is effective against Canine Parvovirus (and Porcine parvovirus) at 8 oz. per gallon. Follow {{Area Of Use}} Disinfection Directions.',NULL,'NA',NULL,NULL,NULL,NULL,156,8,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (37,NULL,'Remove all poultry and feeds from premises, trucks, coops, and crates. Remove all litter and droppings from floors, walls, and surfaces of facilities occupied or traversed by poultry. Empty all troughs, racks, and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with the disinfecting solution (2 oz per gallon of water) (660 ppm active quat) (equivalent use dilution) for a period of 10 minutes. Immerse all halters, ropes and other types of equipment used in handling and restraining animals as well as forks, shovels, and scrapers used in removing litter and manure. Ventilate buildings, coops, and other closed spaces. Do not house poultry or employ equipment until treatment has been absorbed, set, or dried. Thoroughly scrub treated feed racks, troughs, automatic feeders, fountains, and waterers with soap or detergent, and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,157,9,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (45,NULL,'This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. This product may be used to',NULL,'NA',NULL,NULL,NULL,NULL,158,17,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (46,NULL,'Remove heavy soil deposits from surface. Then thoroughly wet surface with a use-solution of  oz. of the concentrate per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7). The use-solution can be applied with a cloth, mop, sponge, or coarse spray, or soaking. For sprayer applications, use a coarse spray device. Spray 6-8 inches from the surface, rub with a brush, cloth or sponge. Do not breathe spray. Let solution remain on surface for a minimum of 10 minutes. Rinse or allow to air dry. Rinsing of floors is not necessary unless they are to be waxed or polished.\r\n\r\nFood contact surfaces must be thoroughly rinsed with potable water. This product must not be used to clean the following food contact surfaces: utensils, glassware and dishes.',NULL,'NA',NULL,NULL,NULL,NULL,159,18,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (47,NULL,'Swab bowl with brush to remove heavy soil prior to cleaning or disinfecting. Clean by applying use-solution around the bowl and up under the rim. Stubborn stains may require brushing. To disinfect, first preclean to remove heavy soil, then remove or expel over the inner trap the residual bowl water. Pour in 3 oz. of the usesolution. Swab the bowl completely using a scrub brush or mop, making sure to get under rim. Let stand for 10 minutes or overnight, then flush',NULL,'NA',NULL,NULL,NULL,NULL,160,19,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (48,NULL,'Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,161,20,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (49,NULL,'Personal Protection: Disposable protective gloves, gowns, face masks, or eye coverings as appropriate must be worn during all cleaning of blood / body fluids and during decontamination procedures. Cleaning Procedures: Blood / body fluids must be thoroughly cleaned from surfaces / objects before application of disinfectant. Contact Time: HIV-1 (AIDS virus) is inactivated after a contact time of 4 minutes at 25#C (77F) (room temperature). HBV and HCV are inactivated after a 10 minute contact time. Use a 10-minute contact time for all other viruses, fungi, and bacteria listed. Disposal of Infectious Materials: Blood / body fluids should be autoclaved and disposed of according to federal, state, and local regulations for infectious waste disposal',NULL,'NA',NULL,NULL,NULL,NULL,162,21,NULL);
