INSERT INTO "s_directionsforusestatement" VALUES (52,NULL,'This product removes body secretions, soil, and blood, along with their accompanying malodor, from the surfaces and orifices of human remains. Using a sponge or washcloth, bathe the entire body with a use-solution of  oz per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7.) A soft hand brush may be employed on surfaces other than the face. Prepare a fresh solution for each (cadaver) remains or when solution becomes visibly dirty or diluted\r\nCarpets:  oz. per gallon of shampoo solution eliminates odors associated with urine, vomit, smoke, and mildew. Reapply after cleaning for freshening effects. Allow to dry.',NULL,'NA',NULL,NULL,NULL,NULL,165,24,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (53,'Recommended','This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.',NULL,'NA',NULL,NULL,NULL,1,166,25,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (54,'DISINFECTION / Cleaning / Deodorizing Directions:','Remove heavy soil deposits from surface. Then thoroughly wet surface with a use-solution of 1/2 oz. of the concentrate per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7). The use-solution can be applied with a cloth, mop, sponge, or coarse spray, or soaking. For sprayer applications, use a coarse spray device. Spray 6-8 inches from the surface, rub with a brush, cloth or sponge. Do not breathe spray. Let solution remain on surface for a minimum of 10 minutes. Rinse or allow to air dry. Rinsing of floors is not necessary unless they are to be waxed or polished.',NULL,'NA',NULL,NULL,NULL,2,174,25,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (55,'TOILET BOWLS [ / URINALS]','Swab bowl with brush to remove heavy soil prior to cleaning or disinfecting. Clean by applying use-solution around the bowl and up under the rim. Stubborn stains may require brushing. To disinfect, first preclean to remove heavy soil, then remove or expel over the inner trap the residual bowl water. Pour in 3 oz. of the usesolution. Swab the bowl completely using a scrub brush or mop, making sure to get under rim. Let stand for 10 minutes or overnight, then flush.',NULL,'NA',NULL,NULL,NULL,3,175,25,NULL);
INSERT INTO "s_directionsforusestatement" VALUES (56,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,4,176,25,NULL);
