INSERT INTO "s_marketingstatement" VALUES (162,NULL,'<p><em><font face=\"Arial\">(Viruses:)</font></em></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial\">*Adenovirus Type 4</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">*Adenovirus Type 7 - at 2 oz. per gallon</span></font></p>\r\n<p style=\"margin-bottom: 0in; margin-left: 0.08in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><font style=\"font-size: 8pt;\" size=\"1\"><em><span style=\"background: #ffff00;\">(Note for Reviewer: 2 oz. per gallon dilution disinfection directions must be used if Adenovirus Type 7 is listed on the label)</span></em></font></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Hepatitis B Virus (HBV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Hepatitis C Virus (HCV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Herpes Simplex Type 1</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Herpes Simplex Type 2</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Human coronavirus</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*HIV-1 (AIDS virus)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Influenza A / Hong Kong</font></p>\r\n<p style=\"margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">*Respiratory Syncytial Virus (RSV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Rubella (German Measles)</font></p>\r\n<p style=\"text-indent: -0.2in; margin-bottom: 0in; margin-left: 0.2in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*SARS Associated Coronavirus [SARS] [cause of Severe Acute Respiratory Syndrome]</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Vaccinia [Pox virus]</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><em>(Animal Viruses:)</em></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Avian polyomavirus</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Canine distemper</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Feline leukemia</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Feline picornavirus </font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Infectious bovine rhinotracheitis</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Infectious bronchitis (Avian IBV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\"><span style=\"background: #ffff00;\">* Newcastle Disease</span></font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Pseudorabies (PRV)</font></p>\r\n<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">*Rabies</font></p>\r\n<p style=\"margin-right: -0.06in; margin-bottom: 0in;\"><font face=\"Arial, sans-serif\">*Transmissible gastroenteritis virus (TGE)</font></p>','R',NULL,3,NULL,90,40,NULL);
