INSERT INTO "s_storagedisposalstatement" VALUES (1,NULL,NULL,'R','<p style=\"margin-bottom: 0in;\" align=\"JUSTIFY\"><font face=\"Arial, sans-serif\">Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.</font></p>',NULL,'NA',NULL,NULL,NULL,NULL,1,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (2,NULL,NULL,'R','<p class=\"western\"><font size=\"2\">Do not contaminate water, food, or feed by storage or disposal. </font></p>',NULL,'NA',NULL,NULL,1,NULL,2,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (3,NULL,'Pesticide Storage','R','<p class=\"western\" align=\"LEFT\"><font size=\"2\">Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.</font></p>',NULL,'NA',NULL,NULL,2,NULL,2,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (4,NULL,'Pesticide Disposal','R','<p>Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.</p>',NULL,'NA',NULL,NULL,3,NULL,2,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (5,NULL,'Container Disposal','R','<p class=\"western\">(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.</p>\r\n<p class=\"western\">(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.</p>\r\n<p class=\"western\">(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.</p>\r\n<p class=\"western\">(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.</p>\r\n<p class=\"western\"></p>',NULL,'NA',NULL,NULL,4,NULL,2,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (6,NULL,NULL,'R','Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,NULL,26,3,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (7,NULL,NULL,'R','Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,1,27,4,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (8,NULL,'Pesticide Storage','R','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,2,28,4,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (9,NULL,'Pesticide Disposal','R','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,3,29,4,NULL);
INSERT INTO "s_storagedisposalstatement" VALUES (10,NULL,'Container Disposal','R','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,'NA',NULL,NULL,4,30,4,NULL);
