INSERT INTO "spld_generalstatement" VALUES (13,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.','R',NULL,NULL,NULL,NULL,NULL,7,19);
INSERT INTO "spld_generalstatement" VALUES (14,NULL,'If on skin or clothing\n   - Take off contaminated clothing.\n   - Rinse skin immediately with plenty of water for 15-20 minutes.',NULL,NULL,NULL,NULL,NULL,1,8,20);
INSERT INTO "spld_generalstatement" VALUES (15,NULL,'If swallowed\n   - Call a poison control center or doctor immediately for treatment advice.\n   - Have person sip a glass of water if able to swallow.\n   - Do not induce vomiting unless told to do so by the poison control center or doctor.\n   - Do not give anything by mouth to an unconscious person.',NULL,NULL,NULL,NULL,NULL,2,8,21);
INSERT INTO "spld_generalstatement" VALUES (16,NULL,'If inhaled\n   - Move person to fresh air.\n   - If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible.',NULL,NULL,NULL,NULL,NULL,3,8,22);
INSERT INTO "spld_generalstatement" VALUES (17,NULL,'If in eyes\r\n   - Hold eye open and rinse slowly and gently with water for 15-20 minutes.\r\n   - Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,NULL,NULL,NULL,NULL,4,8,23);
INSERT INTO "spld_generalstatement" VALUES (18,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.','R',NULL,NULL,NULL,NULL,NULL,9,24);
