INSERT INTO "spld_marketingstatement" VALUES (25,NULL,'Recommended for use in kennels, pet shops, veterinary clinics, animal life science laboratories, breeding establishments, grooming establishments, schools, colleges, federally inspected meat and poultry plants, equine farms, tack shops, zoos, poultry farms, turkey farms, dairy farms, hog farms, and households. Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, nonmedical metal surfaces, non-medical stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.). Recommeded for use in: Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,NULL,NULL,94,8);
INSERT INTO "spld_marketingstatement" VALUES (26,NULL,'For use on Highchairs, Sealed terra cotta, Tanning Equipment, Plastic (such as polystyrene or polypropylene), Upholstery, Floors, Refrigerators, Conductive flooring, Refrigerated storage and display equipment, Glazed enameled surfaces, Garbage cans, Bathtubs (Fiberglass), Counters (countertops), Doorknobs, Stainless steel, Coils and drain pans of air conditioning and refri, Microwave ovens, Laminated surfaces, Tanning Beds, Other hard nonporous surfaces made of:, Sealed granite, Telephones, Desks, Outdoor furniture, Woodwork, Cabinets, Chairs, Sealed terrazzo, Bathroom fixtures, Countertop laminates, Metal, Appliances, Sealed limestone, Kennel runs, Sealed slate, Glazed ceramic and Cages.',NULL,NULL,NULL,NULL,NULL,NULL,95,9);
