INSERT INTO "spld_marketingstatement" VALUES (3363,NULL,'Formulation HWS-256 can be used in the laundry to control odors on musty bedding and linens. Test on a small inconspicuous area before using.','R',NULL,NULL,NULL,NULL,11,154,3327);
INSERT INTO "spld_marketingstatement" VALUES (3364,NULL,'Formulation HWS-256 may be used on mildew stains in damp areas such as bathrooms, showers, kitchens, basements and laundry rooms.','R',NULL,NULL,NULL,NULL,12,155,3327);
INSERT INTO "spld_marketingstatement" VALUES (3365,NULL,'Formulation HWS-256</strong></font><font face=\"Arial, sans-serif\"> may be used in work areas such as tool rooms and garages for odor control and light duty cleaning.','R',NULL,NULL,NULL,NULL,13,156,3327);
INSERT INTO "spld_marketingstatement" VALUES (3366,NULL,'Formulation HWS-256 may be used to remove odors caused by flooding and smoke from fires.','R',NULL,NULL,NULL,NULL,14,157,3327);
