INSERT INTO "spld_marketingstatement" VALUES (3396,NULL,'For use in {{Area Of Use}}. For use in households.',NULL,NULL,NULL,NULL,NULL,NULL,25,3354);
INSERT INTO "spld_marketingstatement" VALUES (3397,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,NULL,NULL,NULL,NULL,NULL,26,3355);
INSERT INTO "spld_marketingstatement" VALUES (3398,NULL,'Fungicidal against Trichophyton mentagrophytes and Candida albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,NULL,NULL,NULL,NULL,NULL,27,3356);
INSERT INTO "spld_marketingstatement" VALUES (3399,NULL,'Virucidal against {{Claim}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum.',NULL,NULL,NULL,NULL,NULL,NULL,28,3357);
INSERT INTO "spld_marketingstatement" VALUES (3400,NULL,'Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)','R',NULL,NULL,NULL,NULL,1,29,3358);
INSERT INTO "spld_marketingstatement" VALUES (3401,NULL,'A multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test. Disinfects, cleans, and deodorizes in one labor-saving step.','R',NULL,NULL,NULL,NULL,2,30,3358);
INSERT INTO "spld_marketingstatement" VALUES (3402,NULL,'Recommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households. Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.','R',NULL,NULL,NULL,NULL,3,31,3358);
INSERT INTO "spld_marketingstatement" VALUES (3403,NULL,'Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical)stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).','R',NULL,NULL,NULL,NULL,4,32,3358);
INSERT INTO "spld_marketingstatement" VALUES (3404,NULL,'Use [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.','R',NULL,NULL,NULL,NULL,5,33,3358);
INSERT INTO "spld_marketingstatement" VALUES (3405,NULL,'Use [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs. Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse. [Caution: Cleaning at the recommended 120F. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]','R',NULL,NULL,NULL,NULL,6,34,3358);
INSERT INTO "spld_marketingstatement" VALUES (3406,NULL,'Recommended for use\r\n\r\nFederally inspected meat and poultry plants on all hard, nonporous surfaces in inedible product processing areas, non-processing areas, and / or exterior areas. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a floor and wall cleaner for use in all departments. Food products and packaging material must be removed from the room or carefully protected. All surfaces must be thoroughly rinsed with potable water.</font></font></p>\r\n\r\nFederally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.','R',NULL,NULL,NULL,NULL,7,35,3358);
INSERT INTO "spld_marketingstatement" VALUES (3407,NULL,'Recommended for use in tanning salons.','R',NULL,NULL,NULL,NULL,8,36,3358);
INSERT INTO "spld_marketingstatement" VALUES (3408,NULL,'Recommended for use on [tanning beds], [and] [tanning equipment]. ','R',NULL,NULL,NULL,NULL,9,37,3358);
INSERT INTO "spld_marketingstatement" VALUES (3409,NULL,'Formulation HWS-256 is effective at controlling mold and mildew odor on mattresses, pillows and shower curtains.','R',NULL,NULL,NULL,NULL,10,38,3358);
INSERT INTO "spld_marketingstatement" VALUES (3410,NULL,'Formulation HWS-256 can be used in the laundry to control odors on musty bedding and linens. Test on a small inconspicuous area before using.','R',NULL,NULL,NULL,NULL,11,39,3358);
INSERT INTO "spld_marketingstatement" VALUES (3411,NULL,'Formulation HWS-256 may be used on mildew stains in damp areas such as bathrooms, showers, kitchens, basements and laundry rooms.','R',NULL,NULL,NULL,NULL,12,40,3358);
INSERT INTO "spld_marketingstatement" VALUES (3412,NULL,'Formulation HWS-256</strong></font><font face=\"Arial, sans-serif\"> may be used in work areas such as tool rooms and garages for odor control and light duty cleaning.','R',NULL,NULL,NULL,NULL,13,41,3358);
INSERT INTO "spld_marketingstatement" VALUES (3413,NULL,'Formulation HWS-256 may be used to remove odors caused by flooding and smoke from fires.','R',NULL,NULL,NULL,NULL,14,42,3358);
INSERT INTO "spld_marketingstatement" VALUES (3414,NULL,'Formulation HWS-256 leaves a clean fresh scent.','R',NULL,NULL,NULL,NULL,15,43,3358);
INSERT INTO "spld_marketingstatement" VALUES (3415,NULL,'Formulation HWS-256 provides long lasting freshness against tough (pet) odors from litter boxes and pet accidents.','R',NULL,NULL,NULL,NULL,16,44,3358);
