INSERT INTO "spld_storagedisposalstatement" VALUES (11,NULL,NULL,'R','Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,5,16);
