INSERT INTO "spld_storagedisposalstatement" VALUES (167,'PESTICIDE STORAGE:',NULL,NULL,'Open dumping is prohibited.  Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,61,77);
INSERT INTO "spld_storagedisposalstatement" VALUES (168,'Pesticide Disposal',NULL,NULL,'Pesticide wastes are acutely hazardous.  Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law.  If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,61,78);
INSERT INTO "spld_storagedisposalstatement" VALUES (169,'Container Disposal',NULL,NULL,'(Plastic containers:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn.  If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles.  Empty residue into application equipment.  Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities.  If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities.  If burned, stay out of smoke.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,61,79);
INSERT INTO "spld_storagedisposalstatement" VALUES (170,'STORAGE AND DISPOSAL',NULL,NULL,'Store in original container in areas inaccessible to children. Do not reuse empty container.  Wrap and discard in trash (or recycle).',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,62,80);
