INSERT INTO "spld_storagedisposalstatement" VALUES (335,'Pesticide Disposal',NULL,'R','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,97,74);
INSERT INTO "spld_storagedisposalstatement" VALUES (336,'Container Handling',NULL,'R','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,97,75);
INSERT INTO "spld_storagedisposalstatement" VALUES (337,NULL,NULL,'R','Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,98,97);
